import React from "react";

function Contant() {
    return (
        <div className="App">
            <h2>RACHEAL OGUNDIPE</h2>
            <h5>Columbus, Georgia. <br>(678) 668-3880 </br></h5>
            <h5>realdipe@gmail.com. </h5>
        <a href="https://www.linkedin.com/in/racheal-ogundipe/"></a>
        </div>
    );
}

export default Contant;
